import { useNavigate } from "react-router";

import mainImage from "../images/logo.png";

function Logo() {
	const navigate = useNavigate();

	return (
		<div
			style={{
				height: "calc(var(--navigation-bar-height) - 3px)",
				marginLeft: "2vw",
				marginTop: "3px",
				fontSize: "calc(((var(--navigation-bar-height) - 10px) * 0.4)",
				display: "flex",
				flexDirection: "row",
				alignItems: "center",
				cursor: "pointer",
			}}
			onClick={() => navigate("/home")}>
			COMAN
			<img src={mainImage} style={{ height: "calc((var(--navigation-bar-height) - 10px) * 0.4)" }} alt='' />
			PP
		</div>
	);
}

export default Logo;
